import Head from 'next/head';
import Navigation from './Navigation';

const Layout = (props) => {
    return (<div>
        <Head>
	        <title>Adanu | HomePage |inspiring communities together</title>
            <meta name='viewport' content='width=device-width, initial-scale=1, user-scalable=no'/>
            <link rel='shortcut icon' href='favicon.ico' />
	        <link rel='stylesheet' href='/wp-content/themes/adanu/css/reset.css' />
	        <link rel='stylesheet' href='/wp-content/themes/adanu/style.css' />
        </Head>
        <Navigation/>
        <div className='responsive_wrapper'>
            {props.children}
        </div>
    </div>);
};

export default Layout;
